7/04/06/22-revision-v1/',0,'revision','',0),(25,1,'2017-04-06 13:35:09','2017-04-06 13:35:09','','Ratts Online','','inherit','closed','closed','','20-revision-v1','','','2017-04-06 13:35:09','2017-04-06 13:35:09','',20,'https://ratts.herokuapp.com/2017/04/06/20-revision-v1/',0,'revision','',0),(28,1,'2017-04-20 02:06:35','2017-04-20 02:06:35','','Dia do Publicitário','','publish','closed','closed','','dia-do-publicitario','','','2017-04-20 02:06:35','2017-04-20 02:06:35','',0,'http://ratts.herokuapp.com/?post_type=produtos&#038;p=28',0,'produtos','',0),(29,1,'2017-04-20 02:04:08','2017-04-20 02:04:08','','diapublicitario','','inherit','open','closed','','diapublicitario','','','2017-04-20 02:04:08','2017-04-20 02:04:08','',0,'https://d3vc2n5vg3qtba.cloudfront.net/uploads/2017/04/diapublicitario.gif',0,'attachment','image/gif',0),(30,1,'2017-04-20 02:12:47','2017-04-20 02:12:47','&nbsp;\r\n\r\nInaugurada em 15 de março de 1987, a TV Ponta Negra é a primeira emissora comercial do Rio Grande do Norte. A emissora criou, através de uma programação local diversificada que sempre abriu espaço para os artistas da terra e um jornalismo atuante e marcado pela prestação de serviço, um vínculo único com o telespectador, que justifica o slogan usado até hoje: “presente na vida da gente”.\r\n\r\nEm janeiro de 2014, a TV Ponta Negra passou a integrar o Sistema Opinião de Comunicação, e desse então, tem investido maciçamente na modernização do parque tecnológico. Uma das primeiras medidas foi a implantação do sinal digital, na Grande Natal, sinal que vai ser expandido para Mossoró e região.\r\n\r\nNo início de 2017, será lançado o portal do Sistema Opinião onde todas as emissoras do grupo estarão conectadas com notícias, vídeos e serviços para a população. Promete ser um dos maiores do nordeste. O intuito é seguir a tendência digital do mercado e se aproximar cada vez mais dos telespectadores.\r\n\r\nPara 2017, ano quando completa 30 anos, a TV Ponta Negra planejou investimentos ainda mais robustos, que vão garantir a programação local em alta definição (HD), com o que há de mais moderno no mercado televisivo brasileiro. E além do ganho substancial na qualidade de imagem, o telespectador potiguar vai poder apreciar novos formatos de programas, que valorizam ainda mais a cultura, a história, a gastronomia, a moda, o turismo e os negócios do Rio Grande do Norte.\r\n\r\nVale dizer que a TV Ponta Negra foca completamente no lado humano dos seus colaboradores. Trabalhando muito o endomarketing que abraça durante todos os dias os funcionários como uma família feliz, família TV Ponta Negra.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n<strong>Mercado</strong>\r\n\r\nA TV Ponta Negra na média geral do Ibope é VICE-LÍDER DE AUDIÊNCIA, com destaque especial para LIDERANÇA ABSOLUTA na faixa horária de 12h às 14h em que lidera com seus programas: PATRULHA DA CIDADE (POLICIAL) E JORNAL DO DIA (JORNALISMO).','Nova marca TV Ponta Negra - 30 Anos','','publish','closed','closed','','nova-marca-tv-ponta-negra-30-anos','','','2017-04-20 02:12:47','2017-04-20 02:12:47','',0,'http://ratts.herokuapp.com/?post_type=produtos&#038;p=30',0,'produtos','',0),(31,1,'2017-04-20 02:08:33','2017-04-20 02:08:33','','outdoor','','inherit','open','closed','','outdoor','','','2017-04-20 02:08:33','2017-04-20 02:08:33','',0,'https://d3vc2n5vg3qtba.cloudfront.net/uploads/2017/04/outdoor.jpg',0,'attachment','image/jpeg',0),(32,1,'2017-04-20 02:08:36','2017-04-20 02:08:36','','tela4','','inherit','open','closed','','tela4','','','2017-04-20 02:08:36','2017-04-20 02:08:36','',0,'https://d3vc2n5vg3qtba.cloudfront.net/uploads/2017/04/tela4.jpg',0,'attachment','image/jpeg',0),(33,1,'2017-04-20 02:08:39','2017-04-20 02:08:39','','tela3','','inherit','open','closed','','tela3','','','2017-04-20 02:08:39','2017-04-20 02:08:39','',0,'https://d3vc2n5vg3qtba.cloudfront.net/uploads/2017/04/tela3.jpg',0,'attachment','image/jpeg',0),(34,1,'2017-04-20 02:08:42','2017-04-20 02:08:42','','tela2','','inherit